tables.table_schema:
CREATE TABLE impact_of_initiatives (
  id UUID PRIMARY KEY,
  initiative_name STRING,
  impact_category STRING,
  impact_score INT
);

CREATE TABLE public_health_outcomes (
  id UUID PRIMARY KEY,
  city STRING,
  outcome_type STRING,
  outcome_value FLOAT
);

CREATE TABLE GreenInitiatives (
  initiative_id INT PRIMARY KEY,
  initiative_name VARCHAR(50),
  start_date DATE,
  end_date DATE
);

CREATE TABLE Locations (
  location_id INT PRIMARY KEY,
  location_name VARCHAR(50),
  city VARCHAR(50),
  country VARCHAR(50)
);
